import "../../css/tickets.css"
import Ticket from "./ticket"
import { useState } from "react"
import index from "../../index"
import noresult from "../../resc/no-result.gif"
import BlobTRight from "../../resc/BlobTRight.png"

const Tickets = () => {
    const [tickets, setTickets] = useState([]);
    index.Client.on("tickets_send", (ticket_a) => {
        setTickets(ticket_a)
    })
    return (
        <div className="tickets-wrapper">
            <div class="tickets-top">
                <span class="tickets-title">Tickets list</span>
            </div>
            <div class="tickets-bottom">
                <div class="tickets-panel">
                    <img className="blob-tright" src={BlobTRight} alt="Not found"></img>
                    {
                        tickets.length === 0 ?
                        (
                            <div class="tickets-content" style={{display: "flex", flexDirection: "row"}}>
                                <img className="tickets-noresults" src={noresult} alt="No Image"></img> 
                            </div>
                        ) : (
                            <div class="tickets-content">
                               
                            </div>
                        )
                    }
                    <div class="tickets-buttons">
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Tickets;
